function Get-HostProfile {
<#
.Synopsis

Returns interesting host configuration data

Author: Lee Christensen (@tifkin_)
License: BSD 3-Clause
Required Dependencies: None
Optional Dependencies: None

.EXAMPLE
Get-HostProfile

#>
    [CmdletBinding()]
    Param(
        [switch]
        $ReturnHashTables
    )

    $Output = @{}
    
    $Output.IsAdmin = (Get-CurrentUserTokenGroupSid | Select-Object -ExpandProperty SID) -contains 'S-1-5-32-544'

    # TODO: Acutally get the integrity level(https://msdn.microsoft.com/en-us/library/bb625966.aspx?f=255&MSPPError=-2147217396)
    $Output.HighIntegrity = ([Security.Principal.WindowsPrincipal] [Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole("Administrator")

    # What versions of the .NET are installed/enabled
    # https://msdn.microsoft.com/en-us/library/bb822049(v=vs.110).aspx  - You really only need CLR 2 or 4 to run all Full .NET code
    $Output.CLRv2 = (Test-Path $env:windir\Microsoft.Net\Framework\v2.0.50727\System.dll)
    $Output.CLRv4 = (Test-Path $env:windir\Microsoft.Net\Framework\v4.0.30319\System.dll)

    # Update mechanisms # TODO:
    $Patches = Get-HotFix
    $Output.LastPatchDate = ($Patches | ?{$_.InstalledOn} | sort -Property InstalledOn -Descending | select -First 1 -ExpandProperty InstalledOn).ToString() # Last patch is not accurate as there may be 
    $Output.InstalledPatches = $Patches | select -ExpandProperty HotfixId | %{$_.ToString()}
    
    $Output.WsusServer = (Get-ItemProperty "HKLM:\SOFTWARE\Policies\Microsoft\Windows\WindowsUpdate" -Name WUServer -ErrorAction SilentlyContinue).WUServer
    $Output.SccmServer = (Get-WmiObject -Namespace "Root\CCM" -Class "SMS_Authority" -ErrorAction SilentlyContinue).CurrentManagementPoint
    #$Output.SccmServer = (Get-ItemProperty 'HKLM:\SOFTWARE\Microsoft\CCMSetup').LastValidMP
    #$Output.SccmSiteCode = (Get-ItemProperty 'HKLM:\SOFTWARE\Microsoft\SMS\Mobile Client\').AssignedSiteCode
    
    # Uptime
    $Output.Uptime = [System.Environment]::TickCount

    # Drivers - File name + version + company
    $Output.RegistrySetting = Get-RegistryGPOSecuritySettings -ReturnHashtables:$ReturnHashTables
    $Output.GPOAdminTemplates = Get-RegistryGPOAdministrativeTemplates -ReturnHashtables:$ReturnHashTables
    $Output.GPOSecuritySettings = Get-RegistryGPOSecuritySettings -ReturnHashtables:$ReturnHashTables
    $Output.SystemEnvironmentVariables = [Hashtable[]](Get-SystemEnvironmentVariables)
    $Output.Process = Get-ProcessProfile -ReturnHashtables:$ReturnHashTables
    $Output.Drivers = Get-Drivers -ReturnHashtables:$ReturnHashTables
    $Output.Connections = Get-NetworkConnection -ReturnHashtables:$ReturnHashTables
    $Output.CachedRDPClientConnections = Get-RegRDPClientConnections -ReturnHashtables:$ReturnHashTables
    $Output.RecentFiles = Get-RecentFiles -ReturnHashtables:$ReturnHashTables
    $Output.PuttyConfiguration = if($ReturnHashTables) {[Hashtable[]](Get-PuttyConfig -ReturnHashtables)} else {Get-PuttyConfig}  # The cast is necessary for the JSON converter
    $Output.WindowsEventForwarding = Get-WindowsEventForwarding -ReturnHashtables:$ReturnHashTables
    $Output.Volumes = Get-VolumeInformation -ReturnHashtables:$ReturnHashTables
    $Output.Registry = Get-RegistrySecuritySettings -ReturnHashtables:$ReturnHashTables

    if($ReturnHashTables) {
        $Keys = New-Object System.String[] $Output.Keys.Count
        $null = $Output.Keys.CopyTo($Keys, 0) # Need to create a copy since the collection might change
        foreach($Key in $Keys) {
            if($Output[$Key] -eq $null -or $Output[$Key] -eq '') {
                $Output.Remove($Key)
            }
        }
    }

    $Output
}


function Get-RegistryGPOSecuritySettings {
    [CmdletBinding()]
    Param (
        [switch]
        $ReturnHashtables
    )

    # Take from the Windows 10 and Windows Server 2016 Policy Settings excel document
    $GPOSecuritySettingsCsv = ''
    $GPOSecuritySettingsCsv = [System.Text.Encoding]::ASCII.GetString((ConvertFrom-CompressedString $GPOSecuritySettingsCsv))
    $GPOSecuritySettings = $GPOSecuritySettingsCsv | ConvertFrom-Csv
    $Output = @{}

    foreach($GPO in $GPOSecuritySettings) {
        $Path = $GPO.'Registry Settings'

        if($Path -match 'are not registry keys' -or $Path -match 'not a registry key') {
            continue
        }


        $ValuePos = $Path.LastIndexOf('\')
        
        $Key = $Path.Substring(0,$ValuePos)
        $ValueName = $Path.Substring($ValuePos+1)

        if($Key.StartsWith('MACHINE\')) {
            $Key = "Registry::HKEY_LOCAL_$($key)"
        } elseif($Key.StartsWith('Machine\')) {
            
            $Split = $Path -split ', value='

            $ValueName = $Split[1]
            $Key = $Split[0].Substring(7)
            $Key = "Registry::HKEY_LOCAL_MACHINE$($key)"

        } elseif($Key.StartsWith('SOFTWARE\')) {
            $Key = "Registry::HKEY_LOCAL_MACHINE\$($key)"
        } else {
            Write-Error "Unexpected GPO security setting path: $Path"
            continue
        }

        #Write-Verbose "Getting $Key ! $ValueName"
        try {
            $Value = (Get-ItemProperty -LiteralPath $Key -Name $ValueName -ErrorAction Stop)."$ValueName"
        } catch [System.Management.Automation.ItemNotFoundException] {
            # Pass through since the key isn't present
            Write-Verbose "Registry key does not exist: $Key ! $ValueName"
            continue
        } catch {
            if($_.Exception.Message -match 'Property.*does not exist') {
                # Do nothing since the value is not present
                Write-Verbose "Registry value does not exist: $Key ! $ValueName"
            } elseif($_.Exception.Message -match 'Requested registry access is not allowed') {
                Write-Error "Access denied to $Key ! $ValueName"
            } else {
                Write-Error $_
            }
            continue
        } 

        $OutputPath = "$($Key -replace 'Registry::HKEY_LOCAL_MACHINE','HKLM')!$($ValueName)"
        
        if($ReturnHashtables) {
            $Output[$OutputPath] = $Value
        } else {
            New-Object PSObject -Property @{
                RegistryPath = $OutputPath
                RegistryValue = $Value
                GPOName = $GPO.'Policy Name'
            }

                    
        }
    }

    if($ReturnHashtables) {
        $Output
    }
}


function Get-RegistryGPOAdministrativeTemplates {
    [CmdletBinding()]
    Param (
        [switch]
        $ReturnHashtables
    )

    $GPOAdminTemplateCsv = ''
    $GPOAdminTemplateCsv = [System.Text.Encoding]::ASCII.GetString((ConvertFrom-CompressedString $GPOAdminTemplateCsv))
    $GPOAdminTemplate = $GPOAdminTemplateCsv | ConvertFrom-Csv
    
    $Output = @{}
    $UserSid = [System.Security.Principal.WindowsIdentity]::GetCurrent().User.Value
    $UserHive = "Registry::HKEY_USERS\$($UserSid)\"

    foreach($GPO in $GPOAdminTemplate) {
        # Some GPOs can be defined in multiple locations. So we split in order to grab each location
        $SplitRegPaths = $GPO.'Registry Information' -split '(HKLM\\|HKCU\\)'
        
        # Process each registry value
        for($i=1; $i -lt $SplitRegPaths.Count; $i+=2) {

            $Hive = $SplitRegPaths[$i]
            $HivePath = $SplitRegPaths[$i+1].Trim()
            $Path = "$($Hive)$($HivePath)"

            if(!$Path.Contains('!')) {
                #Write-Verbose "Handing of only registry keys not supported yet: $Path"
                continue
            }

            $Split = $Path -split '!'
            $Key = $Split[0]
            $ValueName = $Split[1]

            if($Key.StartsWith('HKCU\')) {
                $Key = $Key -replace '^HKCU\\',$UserHive
            } elseif($Key.StartsWith('HKLM\')) {
                $Key = $Key -replace '^HKLM\\','Registry::HKEY_LOCAL_MACHINE\'
            } else {
                Write-Error "Unexpected registry path: $($Path)"
                continue
            }

            try {
                $Value = (Get-ItemProperty -LiteralPath $Key -Name $ValueName -ErrorAction Stop)."$ValueName"
            } catch [System.Management.Automation.ItemNotFoundException] {
                # Pass through since the key isn't present
                Write-Verbose "Registry key does not exist: $Key ! $ValueName"
                continue
            } catch {
                if($_.Exception.Message -match 'Property.*does not exist') {
                    # Do nothing since the value is not present
                    Write-Verbose "Registry value does not exist: $Key ! $ValueName"
                } elseif($_.Exception.Message -match 'Requested registry access is not allowed') {
                    Write-Error "Access denied to $Key ! $ValueName"
                } else {
                    Write-Error $_
                }
                continue
            } 

            $OutputPath = "$($Key)!$($ValueName)"
            if($OutputPath.StartsWith('Registry::HKEY_LOCAL_MACHINE')) {
                $OutputPath = "$($Key -replace 'Registry::HKEY_LOCAL_MACHINE','HKLM')!$($ValueName)"
            } else {
                $OutputPath = "$($Key -replace 'Registry::HKEY_USERS','HKU')!$($ValueName)"
            }

            if($ReturnHashtables) {
                $Output[$OutputPath] = $Value
            } else {
                New-Object PSObject -Property @{
                    RegistryPath = $OutputPath
                    RegistryValue = $Value
                    GPOPath = $GPO.'Policy Path'
                    GPOName = $GPO.'Policy Setting Name'
                }
            }
        }
    }

    if($ReturnHashtables) {
        $Output
    }
}


function Get-RegistrySecuritySettings {
    [CmdletBinding()]
    Param (
        [switch]
        $ReturnHashtables
    )

    $Output = @{}

    # If UAC is disabled, or LocalAccountTokenFilterPolicyElevatedTokens is false, then local accounts can be used for pass-the-hash
    $SystemPolicies = Get-ItemProperty -Path "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Policies\System" -ErrorAction SilentlyContinue
    
    # UAC Settings (Next 3 determine viability of pass-the-hash w/local accounts)
    $Output.EnableLUA = [bool]($SystemPolicies.EnableLUA)
    $Output.LocalAccountTokenFilterPolicy = [bool]($SystemPolicies.LocalAccountTokenFilterPolicy)
    $Output.FilterAdministratorToken = [bool]($SystemPolicies.FilterAdministratorToken)
    
    $Output.UACConsentPromptBehaviorAdmin = $SystemPolicies.ConsentPromptBehaviorAdmin  # 0 == Elevate without prompt (https://technet.microsoft.com/en-us/library/dd835564(v=ws.10).aspx and https://msdn.microsoft.com/en-us/library/cc232761.aspx)
    switch($Output.UACConsentPromptBehaviorAdmin) {
        0 { $Output.UACConsentPromptBehaviorAdmin = "$($SystemPolicies.UACConsentPromptBehaviorAdmin) - No prompting" }
        1 { $Output.UACConsentPromptBehaviorAdmin = "$($SystemPolicies.UACConsentPromptBehaviorAdmin) - PromptOnSecureDesktop" }
        2 { $Output.UACConsentPromptBehaviorAdmin = "$($SystemPolicies.UACConsentPromptBehaviorAdmin) - PromptPermitDenyOnSecureDesktop" }
        3 { $Output.UACConsentPromptBehaviorAdmin = "$($SystemPolicies.UACConsentPromptBehaviorAdmin) - PromptForCredsNotOnSecureDesktop" }
        4 { $Output.UACConsentPromptBehaviorAdmin = "$($SystemPolicies.UACConsentPromptBehaviorAdmin) - PromptForPermitDenyNotOnSecureDesktop" }
        5 { $Output.UACConsentPromptBehaviorAdmin = "PromptForNonWindowsBinaries" }
        default { $Output.UACConsentPromptBehaviorAdmin = "PromptForNonWindowsBinaries" }
    }

    # Command line process auditing
    $Output.CommandLineLogging = [Bool](Get-ItemProperty 'HKLM:\Software\Microsoft\Windows\CurrentVersion\Policies\System\Audit\' -Name ProcessCreationIncludeCmdLine_Enabled -ErrorAction SilentlyContinue).ProcessCreationIncludeCmdLine_Enabled
    

    $PSVersion = $null
    Get-ChildItem HKLM:\SOFTWARE\Microsoft\PowerShell\* | ForEach-Object {
        $PSVersion = (Get-ItemProperty "$($_.PSPath)\PowerShellEngine" -Name PowerShellVersion).PowerShellVersion
    }
    $Output.PSVersion = $PSVersion
    $Output.PSTranscription = [Bool](Get-ItemProperty 'HKLM:\SOFTWARE\Policies\Microsoft\Windows\PowerShell\Transcription' -ErrorAction SilentlyContinue).EnableTranscripting
    $Output.PSTranscriptionDir = (Get-ItemProperty 'HKLM:\SOFTWARE\Policies\Microsoft\Windows\PowerShell\Transcription' -ErrorAction SilentlyContinue).OutputDirectory
    $Output.PSModuleLogging = [Bool](Get-ItemProperty 'HKLM:\SOFTWARE\Policies\Microsoft\Windows\PowerShell\ModuleLogging' -ErrorAction SilentlyContinue).EnableModuleLogging
    $Output.PSScriptBlockLogging = [Bool](Get-ItemProperty 'HKLM:\SOFTWARE\Policies\Microsoft\Windows\PowerShell\ScriptBlockLogging' -ErrorAction SilentlyContinue).EnableScriptBlockLogging
    $Output.ExecutionPolicy = [Bool](Get-ItemProperty 'HKLM:\SOFTWARE\Policies\Microsoft\Windows\PowerShell' -ErrorAction SilentlyContinue).ExecutionPolicy

    
    # LSA Protection - if secure boot is enabled, then flipping the RunAsPPL to 0 won't have an effect
    $Output.LSAProtectedMode = [Bool](Get-ItemProperty 'HKLM:\SYSTEM\CurrentControlSet\Control\Lsa' -Name RunAsPPL -ErrorAction SilentlyContinue).RunAsPPL
    $Output.SecureBoot = [Bool](Get-ItemProperty HKLM:\SYSTEM\CurrentControlSet\Control\SecureBoot\State -Name UEFISecureBootEnabled -ErrorAction SilentlyContinue).UEFISecureBootEnabled
    
    # LAPS
    $Output.LocalAdministratorPasswordSolution = [bool](Test-Path "$env:ProgramFiles\LAPS\cse\AdmPwd.dll")
    $Output.LAPSEnabled = [bool](Get-ItemProperty 'HKLM:\Software\Policies\Microsoft Services\AdmPwd' -Name AdmPwdEnabled -ErrorAction SilentlyContinue).AdmPwdEnabled
    $Output.LAPSAdminAccountName = (Get-ItemProperty 'HKLM:\Software\Policies\Microsoft Services\AdmPwd' -Name AdminAccountName -ErrorAction SilentlyContinue).AdminAccountName
    $Output.LAPSPasswordComplexity = (Get-ItemProperty 'HKLM:\Software\Policies\Microsoft Services\AdmPwd' -Name PasswordComplexity -ErrorAction SilentlyContinue).PasswordComplexity
    $Output.LAPSPasswordLength = (Get-ItemProperty 'HKLM:\Software\Policies\Microsoft Services\AdmPwd' -Name PasswordLength -ErrorAction SilentlyContinue).PasswordLength
    $Output.LAPSPasswordAgeDays = (Get-ItemProperty 'HKLM:\Software\Policies\Microsoft Services\AdmPwd' -Name PasswordAgeDays -ErrorAction SilentlyContinue).PasswordAgeDays
    $Output.LASPwdExpirationProtectionEnabled = (Get-ItemProperty 'HKLM:\Software\Policies\Microsoft Services\AdmPwd' -Name PwdExpirationProtectionEnabled -ErrorAction SilentlyContinue).PwdExpirationProtectionEnabled

    # AlwaysInstall MSI's elevated (Priv Esc misconfiguration)
    $Output.AlwaysInstallElevatedHKCU = [bool](Get-ItemProperty 'HKCU:\Software\Policies\Microsoft\Windows\Installer' -Name AlwaysInstallElevated -ErrorAction SilentlyContinue).AlwaysInstallElevated
    $Output.AlwaysInstallElevatedHKLM = [bool](Get-ItemProperty 'HKLM:\Software\Policies\Microsoft\Windows\Installer' -Name AlwaysInstallElevated -ErrorAction SilentlyContinue).AlwaysInstallElevated    

    $Output.WEFServer = (Get-ItemProperty 'HKLM:\Software\Policies\Microsoft\Windows\EventLog\EventForwarding\SubscriptionManager\' -Name '1' -ErrorAction SilentlyContinue).'1'

    # MS Cached Logons
    $Output.CachedLogonsCount = (Get-ItemProperty 'HKLM:\Software\Microsoft\Windows NT\CurrentVersion\Winlogon' -Name CachedLogonsCount).CachedLogonsCount
    
    # SAMR
    $Output.RemoteSessionEnumeration = Test-RemoteSessionEnumeration
    $Output.RemoteSamrEnumeration = Test-RemoteSamrEnumeration

    $Output.ServerSPNNameValidation = (Get-ItemProperty HKLM:\System\CurrentControlSet\Services\LanManServer\Parameters -Name SmbServerNameHardeningLevel -ErrorAction SilentlyContinue).SmbServerNameHardeningLevel # Default: 0  **** Changed value == No silver ticket tampering,  1==Accept if provided by client, 2==Required from client

    # Local security settings
    $Output.RestrictAnonAccountEnum = [Bool](Get-ItemProperty HKLM:\System\CurrentControlSet\Control\Lsa -Name RestrictAnonymousSAM -ErrorAction SilentlyContinue).RestrictAnonymousSAM # Default: true

    $Output.RestrictAnonShareAndAccountEnum = [Bool](Get-ItemProperty HKLM:\System\CurrentControlSet\Control\Lsa -Name RestrictAnonymou -ErrorAction SilentlyContinue).RestrictAnonymous # Default: false
    $Output.DoNotStoreNetworkAuthCreds = [Bool](Get-ItemProperty HKLM:\System\CurrentControlSet\Control\Lsa -Name DisableDomainCreds -ErrorAction SilentlyContinue).DisableDomainCreds # Default: false (Prevent remembering creds used to access shares)
    $Output.EveryoneIncludesAnonymous = [Bool](Get-ItemProperty HKLM:\System\CurrentControlSet\Control\Lsa -Name EveryoneIncludesAnonymous -ErrorAction SilentlyContinue).EveryoneIncludesAnonymous # Default: false
    $Output.NullSessionNamedPipes = (Get-ItemProperty HKLM:\System\CurrentControlSet\Services\LanManServer\Parameters\ -Name NullSessionPipes -ErrorAction SilentlyContinue).NullSessionPipes # Default: empty string (Named pipes accessible anonymously)
    
    # Next 3 require admin privs
    if($HighIntegrity)
    {
        $Output.RemotelyAccessibleRegPathsXP = (Get-ItemProperty HKLM:\System\CurrentControlSet\Control\SecurePipeServers\Winreg\AllowedPaths -Name Machine -ErrorAction SilentlyContinue).Machine # Default: "System\\CurrentControlSet\\Control\\ProductOptions`nSystem\\CurrentControlSet\\Control\\Server Applications`nSoftware\\Microsoft\\Windows NT\\CurrentVersion"
        $Output.RemotelyAccessibleRegPaths2003 = (Get-ItemProperty HKLM:\System\CurrentControlSet\Control\SecurePipeServers\Winreg\AllowedExactPath -Name Machine -ErrorAction SilentlyContinue).Machine # Default: "System\\CurrentControlSet\\Control\\ProductOptions`nSystem\\CurrentControlSet\\Control\\Server Applications`nSoftware\\Microsoft\\Windows NT\\CurrentVersion"
        $Output.RemotelyAccessibleRegPathsAndSubpaths = (Get-ItemProperty HKLM:\System\CurrentControlSet\Control\SecurePipeServers\Winreg\AllowedPaths -Name Machine -ErrorAction SilentlyContinue).Machine # Default: "System\\CurrentControlSet\\Control\\Print\\Printers`nSystem\\CurrentControlSet\\Services\\Eventlog`nSoftware\\Microsoft\\OLAP Server`nSoftware\\Microsoft\\Windows NT\\CurrentVersion\\Print`nSoftware\\Microsoft\\Windows NT\\CurrentVersion\\Windows`nSystem\\CurrentControlSet\\Control\\ContentIndex`nSystem\\CurrentControlSet\\Control\\Terminal Server`nSystem\\CurrentControlSet\\Control\\Terminal Server\\UserConfig`nSystem\\CurrentControlSet\\Control\\Terminal Server\\DefaultUserConfiguration`nSoftware\\Microsoft\\Windows NT\\CurrentVersion\\Perflib`nSystem\\CurrentControlSet\\Services\\SysmonLog`nSystem\\CurrentControlSet\\Services\\CertSvc`nSystem\\CurrentControlSet\\Services\\Wins"
    }
    else
    {
        $Output.RemotelyAccessibleRegPathsXP = $Output.RemotelyAccessibleRegPaths2003 = $Output.RemotelyAccessibleRegPathsAndSubpaths = '(Access Denied)'
    }

    $Output.NullSessionShares = (Get-ItemProperty HKLM:\System\CurrentControlSet\Services\LanManServer\Parameters -Name NullSessionShares -ErrorAction SilentlyContinue).NullSessionShares # Default: "" (Shares accessible anonymously)
    $Output.TreatLocalUsersAsGuest = [Bool](Get-ItemProperty HKLM:\System\CurrentControlSet\Control\Lsa -Name ForceGuest -ErrorAction SilentlyContinue).ForceGuest # Default: (Domain: true(Classic auth), Workgroup: false(Guest only auth)).  Network logons that use local accounts are automatically mapped to the Guest account. By using the Guest model, you can have all users treated equally. All users authenticate as Guest, and they all receive the same level of access to a given resource, which can be either Read-only or Modify.
    
    $Output.LMCompatibilityLevel = (Get-ItemProperty 'HKLM:\System\CurrentControlSet\Control\LSA' -Name LMCompatibilityLevel -ErrorAction SilentlyContinue).LMCompatibilityLevel # Default: 3
    
    switch($Output.LMCompatibilityLevel)
    {
        0 { $Output.LMCompatibilityLevel = '0-Send LM & NTLM responses'}
        1 { $Output.LMCompatibilityLevel = '1-Send LM & NTLM - Use NTLMv2 session security if negotiated'}
        2 { $Output.LMCompatibilityLevel = '2-Send NTLM response only'}
        3 { $Output.LMCompatibilityLevel = '3-Send NTLMv2 response only(Win7+ default)'}
        4 { $Output.LMCompatibilityLevel = '4-Send NTLMv2 response only. DC: Refuse LM'}
        5 { $Output.LMCompatibilityLevel = '5-Send NTLMv2 response only. DC: Refuse LM & NTLM'}
        default { if(!$Output.LMCompatibilityLevel) { $Output.LMCompatibilityLevel = 'OS Default'} }
    }
    
    $Output.WDigestEnabled = [bool](Get-ItemProperty HKLM:\System\CurrentControlSet\Control\SecurityProviders\WDigest -Name UseLogonCredential -ErrorAction SilentlyContinue).UseLogonCredential

    # Kerberos settings
    $RegKerberosParams = (Get-Item 'HKLM:\Software\Microsoft\Windows\CurrentVersion\Policies\System\Kerberos\Parameters\' -ErrorAction SilentlyContinue)
    if($RegKerberosParams) {
        $KerberosParams = @{}


        $RegKerberosParams.GetValueNames() | %{
            $KerberosParams[$_] = $RegKerberosParams.GetValue($_)
        }
    

        if($KerberosParams['SupportedEncryptiontypes']) {
            if($KerberosParams['SupportedEncryptiontypes'] -eq 0) {
                $KerberosParams['SupportedEncryptiontypes'] = 'No minimum'
            } else {
                $KerbStr = ''
                if($KerberosParams['SupportedEncryptiontypes'] -band 0x1) { $KerbStr += 'DES_CBC_CRC,' }
                if($KerberosParams['SupportedEncryptiontypes'] -band 0x2) { $KerbStr += 'DES_CBC_MD5,' }
                if($KerberosParams['SupportedEncryptiontypes'] -band 0x4) { $KerbStr += 'RC4_HMAC_MD5,' }
                if($KerberosParams['SupportedEncryptiontypes'] -band 0x8) { $KerbStr += 'AES128_HMAC_SHA1,' }
                if($KerberosParams['SupportedEncryptiontypes'] -band 0x10) { $KerbStr += 'AES256_HMAC_SHA1,' }
                if($KerberosParams['SupportedEncryptiontypes'] -band 0x7FFFFFE0) { $KerbStr += 'Future encryption types,' }

                if($KerbStr.Length -gt 0) { $KerbStr = $KerbStr.Remove($KerbStr.Length-1) }
                $KerberosParams['SupportedEncryptiontypes'] = $KerbStr
            }
        }

        $Output.KerberosParams = $KerberosParams
    }

    #                        00000000(0) = No minimum
    #                        00000001(1) = DES_CBC_CRC
    #                        00000010(2) = DES_CBC_MD5
    #                        00000100(4) = RC4_HMAC_MD5
    #                        00001000(8) = AES128_HMAC_SHA1
    #                        00010000(16) = AES256_HMAC_SHA1
    # 1111111111111111111111111100000(2147483616) = Future Encryption Types

    $Output.RestrictSendingNTLMTraffic = (Get-ItemProperty 'HKLM:\System\CurrentControlSet\Control\Lsa\MSV1_0\' -Name RestrictSendingNTLMTraffic -ErrorAction SilentlyContinue).RestrictSendingNTLMTraffic
    switch($Output.RestrictSendingNTLMTraffic) {
        0 { $Output.RestrictSendingNTLMTraffic = 'Allow all' }
        1 { $Output.RestrictSendingNTLMTraffic = 'Audit all' }
        2 { $Output.RestrictSendingNTLMTraffic = 'Deny all' }
        $null { $Output.RestrictSendingNTLMTraffic = 'Allow all' }
    }

    $Output.RestrictReceivingNTLMTraffic = (Get-ItemProperty 'HKLM:\System\CurrentControlSet\Control\Lsa\MSV1_0\' -Name RestrictReceivingNTLMTraffic -ErrorAction SilentlyContinue).RestrictReceivingNTLMTraffic
    switch($Output.RestrictReceivingNTLMTraffic) {
        0 { $Output.RestrictReceivingNTLMTraffic = 'Allow all' }
        1 { $Output.RestrictReceivingNTLMTraffic = 'Deny all domain accounts' }
        2 { $Output.RestrictReceivingNTLMTraffic = 'Deny all accounts' }
        $null { $Output.RestrictReceivingNTLMTraffic = 'Allow all' }
    }

    $Output.AuditReceivingNTLMTraffic = (Get-ItemProperty 'HKLM:\System\CurrentControlSet\Control\Lsa\MSV1_0\' -Name AuditReceivingNTLMTraffic -ErrorAction SilentlyContinue).AuditReceivingNTLMTraffic
    switch($Output.AuditReceivingNTLMTraffic) {
        0 { $Output.AuditReceivingNTLMTraffic = 'Disabled' }
        1 { $Output.AuditReceivingNTLMTraffic = 'Enable auditing for domain accounts' }
        2 { $Output.AuditReceivingNTLMTraffic = 'Enabled auditing for all accounts' }
        $null { $Output.AuditReceivingNTLMTraffic = 'Allow all' }
    }

    # TODO: Needs testing
    $Output.DeviceAutorunSettings = (Get-ItemProperty 'HKLM:\Software\Microsoft\Windows\CurrentVersion\Policies\Explorer' -Name NoDriveTypeAutoRun -ErrorAction SilentlyContinue).NoDriveTypeAutoRun

    # SCM Privileges, if customized
    $SCMPrivs = (Get-ItemProperty 'HKLM:\SYSTEM\CurrentControlSet\Control\ServiceGroupOrder\Security' -ErrorAction SilentlyContinue).Security
    if($SCMPrivs) {
        $Output.SCMSecurityDescriptor = [Convert]::ToBase64String($SCMPrivs)
    }


    if($ReturnHashtables) {
        $Output
    } else {
        New-Object PSObject -Property $Output
    }
}



function ConvertTo-JsonV2 {
    [CmdletBinding()]
    Param(
        $Obj
    )
    
    Begin {
        $null = [System.Reflection.Assembly]::LoadWithPartialName("System.Web.Extensions")
        $Serializer = New-Object System.Web.Script.Serialization.JavaScriptSerializer
    }

    Process {
        try {
            $Serializer.Serialize($Obj)
        } catch {
            Write-Error $_
        }
    }
}